import styled from "styled-components";
import { motion } from "framer-motion";

const SearchComponentStyle = styled(motion.div)`
  margin-top: 10vw;
  position: relative;
  display: flex;
  flex-direction: column;
  margin-left: 5vw;
  background-color: black;
  width: 90vw;
  .searchBar {
    display: flex;
    padding: 2vw;
    background-color: beige;
    width: 50vw;
    .icon {
      height: 50px;
      width: 50px;
      max-height: 50px;
      max-width: 50px;
      background-color: aqua;
      margin-right: 3vw;
      border-radius: 100%;
    }
  }
  .suggest {
    height: auto;
    width: 50vw;
    background-color: blue;
    height: auto;
    display: flex;
    flex-direction: column;
    .result {
      padding: 1vw;
      background-color: brown;
      font-size: 24px;
      span {
        font-size: 20px;
      }
    }
  }
`;

const variants = {
  visible: (custom) => ({
    opacity: [0, 1],
    transition: { delay: custom / 5, duration: 0.5 },
  }),
};

const SearchComponent = () => {
  return (
    <SearchComponentStyle>
      <div className="searchBar">
        <div className="icon" />
        <input onClick={() => {}} />
      </div>
      <div className="suggest">
        <motion.span className="result" custom={1} animate="visible">
          programmers <span> 201 article </span>
        </motion.span>
        <motion.span
          className="result"
          custom={2}
          animate="visible"
          variants={variants}
        >
          css <span> 21 article </span>
        </motion.span>
        <motion.span
          className="result"
          custom={3}
          animate="visible"
          variants={variants}
        >
          webiste <span> 150 article </span>
        </motion.span>
      </div>
    </SearchComponentStyle>
  );
};
export default SearchComponent;
